    false,nt"url": null,nt"notes": "This year's trapping proposal for Arapaho
    National Wildlife Refuge will extend only to the nuisance furbearer species (muskrat
    and beaver), as predators will be addressed under a Predator Management Plan. Arapaho's
    trapping program for control of beaver will begin on October 1st, and for muskrat
    on November 1st with both extending through February 28, if necessary to achieve
    desired results. The program will be different this year in that the refuge will
    issue special use permits for the removal of species causing problems. In the past
    the refuge used recreational trappers to serve this need.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
